import * as React from "react";
import { View, Text } from "react-native";
import './assets/js/script.js'

export default function menu() {
  return (
    <View
      style={{
        backgroundColor: 'green',
      }}
    >
      <div id="menu">
        <a href="#news">News</a>
        <a href="#contact">Contact</a>
        <a href="#about">About</a>
      </div>
      <a href='#' onClick={menu}>
        menubutton
        </a>
    </View>
  );
}

menu();
